(1, 0, 3, 1, 'This is my first comment here', '<p>Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing</p>', '127.0.0.1', 1277742420, 0, 1, '01/', 'admin', '', ''),
(4, 0, 3, 1, 'This is my first reply comment here', '<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur,</p>', '127.0.0.1', 1277750820, 0, 1, '02/', 'admin', '', ''),
(5, 4, 3, 1, 'This is my second comment here', '<p>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don&#39;t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn&#39;t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet.</p>', '127.0.0.1', 1277750940, 0, 1, '02.00/', 'admin', '', ''),
(6, 5, 3, 1, 'This is an awesome theme! and it''s in Drupal & that''s great!', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', '127.0.0.1', 1278595800, 0, 4, '02.00.00/', 'admin', '', ''),
(8, 0, 3, 0, 'wow this is amazing theme.', 'wow this is amazing theme.', '127.0.0.1', 1278655569, 1, 4, '03/', '', '', '');
