('node/add/blog', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"blog";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/blog', 'Blog entry', 'check_plain', '', 6, '', 'A <em>blog entry</em> is a single post to an online journal, or <em>blog</em>.', '', 0, 'modules/node/node.pages.inc'),
('node/add/book', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"book";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/book', 'Book page', 'check_plain', '', 6, '', 'A <em>book page</em> is a page of content, organized into a collection of related entries collectively known as a <em>book</em>. A <em>book page</em> automatically displays links to adjacent pages, providing a simple navigation system for organizing and reviewing structured content.', '', 0, 'modules/node/node.pages.inc'),
('node/add/forum', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:5:"forum";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/forum', 'Forum topic', 'check_plain', '', 6, '', 'A <em>forum topic</em> is the initial post to a new discussion thread within a forum.', '', 0, 'modules/node/node.pages.inc'),
('node/add/page', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"page";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/page', 'Page', 'check_plain', '', 6, '', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 0, 'modules/node/node.pages.inc'),
('node/add/poll', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:4:"poll";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/poll', 'Poll', 'check_plain', '', 6, '', 'A <em>poll</em> is a question with a set of possible responses. A <em>poll</em>, once created, automatically provides a simple running count of the number of votes received for each response.', '', 0, 'modules/node/node.pages.inc'),
('node/add/project', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:7:"project";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/project', 'Project', 'check_plain', '', 6, '', 'Add your project Items here.', '', 0, 'modules/node/node.pages.inc'),
('node/add/story', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:5:"story";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/story', 'Story', 'check_plain', '', 6, '', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 0, 'modules/node/node.pages.inc'),
