(40, 40, 1, 'Block Flexibility''s', '<p>This theme is based on 12 column grids, below are the few example blocks created just to show the extensive theme flexibility. <strong>I have assigned all these blocks in one single region <span data-scayt_word=".i.e" data-scaytid="1">.i.e</span>. postscript top region, there are 17 such regions! You can think about the theme flexibility now isint it ? :)</strong></p>', '<p>This theme is based on 12 column grids, below are the few example blocks created just to show the extensive theme flexibility. <strong>I have assigned all these blocks in one single region <span data-scayt_word=".i.e" data-scaytid="1">.i.e</span>. postscript top region, there are 17 such regions! You can think about the theme flexibility now isint it ? :)</strong></p>', '', 1310921916, 1),
(41, 41, 1, 'Theme Features', '<p><strong>This is a complete bunch of awesome beautiful web-design with extensive power of Drupal.</strong></p><h3>Below are few highlights on theme features: -</h3><ul class="star-list"><li>Fixed/ Fluid Layout Options.</li><li>3 Column Layout Options.</li><li>11 (eleven) Color/background options.</li><li>Jquery animated any level menu</li><li>Cross Browser Compaitable (All major browsers including ie6, ie7, ie8, firefox, safari, chrome)</li></ul><h3>More Features</h3><ul class="arrow-list"><li>Jquery Powered Dynamic Display Block, a beautiful front featured.</li><li><a href="../top-stories">Top Stories of the week</a></li><li>All Content Type&#39;s are Themed.<ul><li><a href="../blog">Blog</a></li><li><a href="my-first-example-book">Book</a></li><li><a href="../forum">Forum</a></li><li><a href="../node/1">Poll</a></li><li><a href="example-page">Page</a></li><li><a href="example-story">Story</a></li></ul></li><li><strong><a href="block-settings-glance">Advanced theme settings.</a></strong></li><li><strong><a href="block-settings-glance">Advanced block settings.</a></strong></li><li><strong>Extensive Block Flexibility.</strong></li><li><strong>3 Block themes.</strong></li><li><strong>Animated Quick Tabs.</strong></li><li>Typewriter style <strong>quick news</strong> block.</li><li>Beautifully themed <strong>Contact Form in the bottom</strong> for your quick contact for your website users.</li><li><a href="typography">Advanced Typography Options.</a></li><li>Sub-Theming facility. <strong>(Easily Update/upgrade your Theme)</strong><p>Meaning you are provided with a separate folder for you work .i.e. city_magazine_custom theme. Work only in city_magazine_custom folder so that all original code can be kept separated, so that if there are any more updates in city_magazine then you just need to update the city_magazine folder and you own changes will remain there with you and you theme will be easily updated.</p></li></ul><h3>Not just a theme, but a complete installation package.</h3><p><strong>Remember this is an addictive theme more you will see more you will love it :).</strong></p><p><strong>An easy one-click quick start theme. All modules are preconfigured and installed in the theme (installation profile) and start posting you content, stories, news etc.</strong></p><p><strong>Super easy installing the theme: -</strong></p><ul class="check-list"><li>City Magazine comes with installation profile, you just need to create the database for your website (<a href="http://drupal.org/getting-started/6/install/create-database">learn more</a>)</li><li>Follow all the steps that you need while installing Drupal (<a href="http://drupal.org/getting-started/install">learn more</a>). During choosing profile, select the City Magazine as an installation profile.</li><li>Once you have successfully installed the City Magazine Theme, browse to your website address (as you installed.)</li><li>The default admin access for your site will be as username/password - admin/admin. Please change your password from admin to your desired password immediately for security purpose.</li><li>You new advanced Drupal theme is installed. Enjoy!</li><li>IF you face any problem related the theme let me know I will be always there to help you.</li><li>These are the only few features. More you will use the theme more you will be loving it.</li></ul><h3>List of the Modules Used</h3><div class="cleafix" style="clear: both;"><div style="width: 48%; float: left; margin-right: 1%;"><ul class="arrow-list"><li>admin_menu</li><li>better_formats</li><li>better_messages</li><li>cck</li><li>comment_notify</li><li>css_gzip</li><li>ddblock</li><li>demo</li><li>imagefield</li><li>imagecache</li><li>imageapi</li><li>filefield</li><li>imce</li><li>imce_wysiwyg</li><li>jquery_update</li></ul></div><div style="width: 48%; float: left; margin-right: 1%;"><ul class="arrow-list"><li>lightbox2</li><li>page_title</li><li>menu_block</li><li>nice_menus</li><li>nodequeue</li><li>pathauto</li><li>pngfix</li><li>quicktabs</li><li>skinr</li><li>token</li><li>views</li><li>views_bbc_ticker</li><li>webform</li><li>wysiwyg</li></ul></div></div>', '<p><strong>This is a complete bunch of awesome beautiful web-design with extensive power of Drupal.</strong></p>', '', 1278681359, 2),
